[{"location":"examples/von_mises_plasticity_mixed_hardening/#","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"EditURL = \"https://github.com/fredrikekre/ConstLab.jl/blob/master/docs/src/literate/von_mises_plasticity_mixed_hardening.jl\"","category":"page"},{"location":"examples/von_mises_plasticity_mixed_hardening/#Von-Mises-Plasticity-with-Mixed-Hardening-1","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"","category":"section"},{"location":"examples/von_mises_plasticity_mixed_hardening/#Load-packages-1","page":"Von Mises Plasticity with Mixed Hardening","title":"Load packages","text":"","category":"section"},{"location":"examples/von_mises_plasticity_mixed_hardening/#","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"using Tensors, ConstLab\nusing ConstLab: MixedControl, Plastic, PlasticState","category":"page"},{"location":"examples/von_mises_plasticity_mixed_hardening/#Define-the-strain-control-1","page":"Von Mises Plasticity with Mixed Hardening","title":"Define the strain control","text":"","category":"section"},{"location":"examples/von_mises_plasticity_mixed_hardening/#","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"ncycles = 5\ntimesteps = range(0.0, 2pi*ncycles; length=200*ncycles)\nε_amp = 0.005 # Strain amplitute for ε_11\nctrl = MixedControl(\n    # Strain\n    t -> SymmetricTensor{2,3}((i,j) -> i == j == 1 ? ε_amp*sin(t) : 0.0),\n    # Controlled strain components\n    SymmetricTensor{2,3}((true, false, false, false, false, false)),\n    # Stress\n    t -> zero(SymmetricTensor{2,3}),\n    # Controlled stress components\n    SymmetricTensor{2,3}((false, true, true, true, true, true))\n);\nnothing #hide","category":"page"},{"location":"examples/von_mises_plasticity_mixed_hardening/#Set-material-parameters-1","page":"Von Mises Plasticity with Mixed Hardening","title":"Set material parameters","text":"","category":"section"},{"location":"examples/von_mises_plasticity_mixed_hardening/#","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"E = 200.0e9\nν =  0.3\nG = E/(2*(1+ν))\nK = E/(3*(1-2*ν))\nσ_y = 200.0e6\nH = 0.1*E\nκ∞ = 0.2*σ_y\nα∞ = 0.1*σ_y\nr = 0.5\n\nmodel = Plastic(G, K, σ_y, H, κ∞, α∞, r);\nnothing #hide","category":"page"},{"location":"examples/von_mises_plasticity_mixed_hardening/#Set-initial-conditions-1","page":"Von Mises Plasticity with Mixed Hardening","title":"Set initial conditions","text":"","category":"section"},{"location":"examples/von_mises_plasticity_mixed_hardening/#","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"s0 = PlasticState{3}();\nnothing #hide","category":"page"},{"location":"examples/von_mises_plasticity_mixed_hardening/#Do-integration-1","page":"Von Mises Plasticity with Mixed Hardening","title":"Do integration","text":"","category":"section"},{"location":"examples/von_mises_plasticity_mixed_hardening/#","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"res = ConstLab.integrate(model, ctrl, timesteps, s0; solver_params=Dict(:method => :newton));\nnothing #hide","category":"page"},{"location":"examples/von_mises_plasticity_mixed_hardening/#Plot-results-1","page":"Von Mises Plasticity with Mixed Hardening","title":"Plot results","text":"","category":"section"},{"location":"examples/von_mises_plasticity_mixed_hardening/#","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"using PGFPlotsX, LaTeXStrings\n\np = @pgf Axis({xlabel=L\"\\varepsilon_{11}\", ylabel=L\"\\sigma_{11}\"},\n    PlotInc({mark=\"none\"},\n        Coordinates([r.ε[1,1] for r in res],\n                    [r.σ[1,1] for r in res])\n    ),\n)","category":"page"},{"location":"examples/von_mises_plasticity_mixed_hardening/#","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"","category":"page"},{"location":"examples/von_mises_plasticity_mixed_hardening/#","page":"Von Mises Plasticity with Mixed Hardening","title":"Von Mises Plasticity with Mixed Hardening","text":"This page was generated using Literate.jl.","category":"page"},{"location":"#","page":"Home","title":"Home","text":"DocTestSetup = :(using JuAFEM)","category":"page"},{"location":"#ConstLab.jl-1","page":"Home","title":"ConstLab.jl","text":"","category":"section"}]
